import React, { useState, FormEvent } from 'react';
import { personalInfo, translations } from '../data/mock';
import { Mail, Phone, MapPin, Send, MessageSquare } from 'lucide-react';

interface ContactProps {
  lang: 'en' | 'id';
}

interface FormData {
  name: string;
  email: string;
  subject: string;
  message: string;
}

const Contact: React.FC<ContactProps> = ({ lang }) => {
  const [formData, setFormData] = useState<FormData>({
    name: '',
    email: '',
    subject: '',
    message: ''
  });
  const [isSubmitting, setIsSubmitting] = useState(false);
  const [showSuccess, setShowSuccess] = useState(false);
  const [errors, setErrors] = useState<Partial<FormData>>({});

  const t = translations[lang];

  const validateForm = (): boolean => {
    const newErrors: Partial<FormData> = {};

    if (!formData.name.trim()) newErrors.name = 'Required';
    if (!formData.email.trim()) {
      newErrors.email = 'Required';
    } else if (!/^[^\s@]+@[^\s@]+\.[^\s@]+$/.test(formData.email)) {
      newErrors.email = 'Invalid email';
    }
    if (!formData.subject.trim()) newErrors.subject = 'Required';
    if (!formData.message.trim()) newErrors.message = 'Required';

    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = async (e: FormEvent) => {
    e.preventDefault();

    if (!validateForm()) return;

    setIsSubmitting(true);

    // Simulate form submission (prepare for future backend integration)
    setTimeout(() => {
      console.log('Form submitted:', formData);
      setIsSubmitting(false);
      setShowSuccess(true);
      setFormData({ name: '', email: '', subject: '', message: '' });

      // Hide success message after 5 seconds
      setTimeout(() => setShowSuccess(false), 5000);
    }, 1500);
  };

  const handleChange = (e: React.ChangeEvent<HTMLInputElement | HTMLTextAreaElement>) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
    // Clear error when user starts typing
    if (errors[name as keyof FormData]) {
      setErrors(prev => ({ ...prev, [name]: undefined }));
    }
  };

  const openWhatsApp = () => {
    const message = encodeURIComponent(
      lang === 'en'
        ? 'Hello! I would like to discuss a project with you.'
        : 'Halo! Saya ingin mendiskusikan proyek dengan Anda.'
    );
    window.open(`https://wa.me/${personalInfo.whatsapp}?text=${message}`, '_blank');
  };

  return (
    <section id="contact" className="px-6 py-20 bg-gray-800">
      <div className="max-w-6xl mx-auto">
        {/* Section Header */}
        <div className="mb-16 text-center">
          <h2 className="mb-4 text-4xl font-bold text-white md:text-5xl">
            {t.contact.title}
          </h2>
          <p className="text-lg text-gray-400">{t.contact.subtitle}</p>
        </div>

        <div className="grid grid-cols-1 gap-8 lg:grid-cols-3">
          {/* Contact Info */}
          <div className="space-y-6 lg:col-span-1">
            {/* Email */}
            <div className="p-6 transition-all duration-300 bg-gray-900 border border-gray-700 rounded-2xl hover:border-green-500/50">
              <div className="flex items-center justify-center w-12 h-12 mb-4 bg-gradient-to-br from-green-500/20 to-blue-500/20 rounded-xl">
                <Mail className="w-6 h-6 text-green-400" />
              </div>
              <h3 className="mb-2 font-semibold text-white">{t.contact.info.email}</h3>
              <a
                href={`mailto:${personalInfo.email}`}
                className="text-sm text-gray-400 break-all transition-colors duration-300 hover:text-green-400"
              >
                {personalInfo.email}
              </a>
            </div>

            {/* Phone */}
            <div className="p-6 transition-all duration-300 bg-gray-900 border border-gray-700 rounded-2xl hover:border-green-500/50">
              <div className="flex items-center justify-center w-12 h-12 mb-4 bg-gradient-to-br from-green-500/20 to-blue-500/20 rounded-xl">
                <Phone className="w-6 h-6 text-green-400" />
              </div>
              <h3 className="mb-2 font-semibold text-white">{t.contact.info.phone}</h3>
              <p className="text-sm text-gray-400">{personalInfo.phone}</p>
            </div>

            {/* Location */}
            <div className="p-6 transition-all duration-300 bg-gray-900 border border-gray-700 rounded-2xl hover:border-green-500/50">
              <div className="flex items-center justify-center w-12 h-12 mb-4 bg-gradient-to-br from-green-500/20 to-blue-500/20 rounded-xl">
                <MapPin className="w-6 h-6 text-green-400" />
              </div>
              <h3 className="mb-2 font-semibold text-white">{t.contact.info.location}</h3>
              <p className="text-sm text-gray-400">{personalInfo.location[lang]}</p>
            </div>

            {/* WhatsApp Button */}
            <button
              onClick={openWhatsApp}
              className="flex items-center justify-center w-full gap-2 px-6 py-4 font-medium text-white transition-all duration-300 bg-green-500 shadow-lg hover:bg-green-600 rounded-xl hover:shadow-green-500/30 hover:scale-105"
            >
              <MessageSquare className="w-5 h-5" />
              WhatsApp
            </button>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Contact;
